import React from 'react'
import "./Hp.css"
function Home(props) {
  return (
    <div className='workout'>

      {
        props.data.map((e) => {
          return
          <div class="card">
            <p class="heading">
              Popular this month
            </p>
            {<img src="image.jpg"></img>}
            <p>
              Powered By
            </p>
          </div>
        })
      }


    </div>


  )
}

export default Home
